members.comment:
Returns the last element of a string separated by a separator.
If the separator is not found, the whole string is returned.
If the string is empty, null is returned.
Example:
$(DDOX_UNITTEST_HEADER __unittest_L364_C1)
---
string a = null;
assert(isNull(a));
assert(a.isNull);

a = "";
assert(!isNull(a));
assert(!a.isNull);

a = "xyz";
assert(!isNull(a));
assert(!a.isNull);
assert(!"xyz".isNull);

---
$(DDOX_UNITTEST_FOOTER __unittest_L364_C1)

